import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Home extends Component {


	render(){
		return (
			<div className="container">
				<div className="title row align-items-center justify-content-center">
					<h1 className="display-2"> Snapchat Web Version </h1>
				</div>
				<div className="row mt-5 align-items-center justify-content-center">
					<div className="col-sm"> 
						<p>Vous avez un compte ? Connectez vous !</p>
						<Link to="/login" className="btn btn-primary align-items-center justify-content-center">Connection</Link>
					</div>
					<div className="col-sm">
						<p>Vous n'avez pas de compte ? Inscrivez vous !</p>
						<Link to="/register" className="btn btn-primary align-items-center justify-content-center">Inscription</Link>
					</div>
				</div>
			</div>


			);
	}
}
